import React, { Component } from 'react'
import { Link } from "react-router-dom";


const ServiceHead = [

	{
		head: 'Engineering'
	},
	{
		head: 'DevOps'
	},
	{
		head: 'Emerging Technologies'
	},
	{
		head: 'Quality Engineering'
	},
	{
		head: 'Staffing Augmentation'
	},
	{
		head: 'Digital Transformation'
	}
]

const ListItemEngineering = [
	{
		head: 'Engineering'
	},	

	{
		linkText: 'Web Apps Development',
		hrefLink: '/service'
	},
	{
		linkText: 'Mobile Apps Development',
		hrefLink: '/service'
	},
	{
		linkText: 'Application Modernisation',
		hrefLink: '/service'
	},
	{
		linkText: 'Design Consulting',
		hrefLink: '/service'
	}

]

export default class megaServiceItem extends Component {
	render() {
		return (
			<>
				<div className="dropdown-menu" aria-labelledby="navbarDropdown">
					<div className="container common-container-wdt">
						<div className="service-fl-box">
							{ ListItemEngineering.map((element) => ( 
								<div className="service-box">
									<div className='prd-services-content'>
										<h4>{element.head}</h4>
										<ul>
										{ ListItemEngineering.map((element) => {
											return <li><Link to={element.hrefLink}>{element.linkText}</Link></li>
										})}
										</ul>
									</div>
								</div>
							))}
						</div>
					</div>
				</div>
			</>
		)
	}
}
